private void initNodeLabels() {
  if (this.labels != null) {
    return;
  }
  RemoveFromClusterNodeLabelsRequestProtoOrBuilder p =
      viaProto ? proto : builder;
  this.labels = new HashSet<String>();
  this.labels.addAll(p.getNodeLabelsList());
}
